There is a very thin line between No makeup & No make up Makeup look.

Important thing to remember is that no makeup makeup look is achieved using all the makeup products like any other makeup look, however the balance and color choice is the key. 

The main key is to use your PERSONAL COLORS to achieve this look. Personal colours are the colours from your body like the colours of your skin, eyes, lips, hair, brows etc. 
these colours will give u a natural no makeup makeup look without making them look like ARTIFICIAL 
